// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title CheckIn
 * @dev Smart contract for recording check-ins on-chain
 */
contract CheckIn is Ownable {
    constructor() Ownable(msg.sender) {}

    // Check-in structure
    struct CheckInRecord {
        uint256 eventId;
        address user;
        uint256 timestamp;
        bool exists;
    }

    // Mapping from event ID to check-in records
    mapping(uint256 => mapping(address => CheckInRecord)) public checkIns;

    // Mapping from event ID to check-in count
    mapping(uint256 => uint256) public eventCheckInCounts;

    // Array of check-in records per event
    mapping(uint256 => address[]) public eventCheckInUsers;

    // Events
    event CheckedIn(
        uint256 indexed eventId,
        address indexed user,
        uint256 timestamp
    );

    /**
     * @dev Record a check-in (only callable by owner)
     * @param eventId Event ID
     * @param user User address
     */
    function recordCheckIn(uint256 eventId, address user) public onlyOwner {
        require(user != address(0), "Invalid user address");
        require(!checkIns[eventId][user].exists, "Already checked in");

        checkIns[eventId][user] = CheckInRecord({
            eventId: eventId,
            user: user,
            timestamp: block.timestamp,
            exists: true
        });

        eventCheckInCounts[eventId]++;
        eventCheckInUsers[eventId].push(user);

        emit CheckedIn(eventId, user, block.timestamp);
    }

    /**
     * @dev Batch record check-ins (only callable by owner)
     * @param eventId Event ID
     * @param users Array of user addresses
     */
    function batchRecordCheckIn(uint256 eventId, address[] memory users) public onlyOwner {
        require(users.length <= 100, "Batch too large");
        for (uint256 i = 0; i < users.length; i++) {
            if (!checkIns[eventId][users[i]].exists) {
                recordCheckIn(eventId, users[i]);
            }
        }
    }

    /**
     * @dev Check if user has checked in for an event
     * @param eventId Event ID
     * @param user User address
     */
    function hasCheckedIn(uint256 eventId, address user) public view returns (bool) {
        return checkIns[eventId][user].exists;
    }

    /**
     * @dev Get check-in record for a user and event
     * @param eventId Event ID
     * @param user User address
     */
    function getCheckIn(uint256 eventId, address user) public view returns (CheckInRecord memory) {
        require(checkIns[eventId][user].exists, "Check-in not found");
        return checkIns[eventId][user];
    }

    /**
     * @dev Get check-in count for an event
     * @param eventId Event ID
     */
    function getCheckInCount(uint256 eventId) public view returns (uint256) {
        return eventCheckInCounts[eventId];
    }

    /**
     * @dev Get all users who checked in for an event
     * @param eventId Event ID
     */
    function getEventCheckInUsers(uint256 eventId) public view returns (address[] memory) {
        return eventCheckInUsers[eventId];
    }
}

contracts/EventManagement.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title EventManagement
 * @dev Smart contract for managing hackathon events on-chain
 */
contract EventManagement {
    // Custom errors for gas optimization
    error InvalidTimeRange();
    error EmptyEventName();
    error InvalidTimeSequence();
    error StringTooLong();
    error EventNotFound();
    error Unauthorized();
    error InvalidPrizeCount();

    // Constants
    uint256 public constant MAX_STRING_LENGTH = 500; // Maximum length for string fields
    uint256 public constant MAX_PRIZES = 50; // Maximum number of prizes per event

    // Event stage enumeration
    enum EventStage {
        Registration,
        CheckIn,
        Submission,
        Voting,
        Awards,
        Ended
    }

    // Event structure
    struct Event {
        uint256 id;
        string name;
        string description;
        string location;
        uint256 startTime;
        uint256 endTime;
        uint256 registrationStartTime;
        uint256 registrationEndTime;
        uint256 checkInStartTime;
        uint256 checkInEndTime;
        uint256 submissionStartTime;
        uint256 submissionEndTime;
        uint256 votingStartTime;
        uint256 votingEndTime;
        EventStage currentStage;
        address organizer;
        bool allowSponsorVoting;
        bool allowPublicVoting;
        bool exists;
    }

    // Prize structure
    struct Prize {
        uint256 rank;
        string name;
        string description;
        string amount;
    }

    // Mapping from event ID to Event
    mapping(uint256 => Event) public events;

    // Mapping from event ID to prizes
    mapping(uint256 => Prize[]) public eventPrizes;

    // Event counter
    uint256 public eventCounter;

    // Events
    event EventCreated(
        uint256 indexed eventId,
        string name,
        address indexed organizer,
        uint256 startTime,
        uint256 endTime
    );

    event EventStageUpdated(
        uint256 indexed eventId,
        EventStage oldStage,
        EventStage newStage
    );

    event EventUpdated(
        uint256 indexed eventId,
        string name
    );

    /**
     * @dev Create a new hackathon event
     * @param _name Event name
     * @param _description Event description
     * @param _location Event location
     * @param _startTime Event start timestamp
     * @param _endTime Event end timestamp
     * @param _registrationStartTime Registration start timestamp
     * @param _registrationEndTime Registration end timestamp
     * @param _checkInStartTime Check-in start timestamp
     * @param _checkInEndTime Check-in end timestamp
     * @param _submissionStartTime Submission start timestamp
     * @param _submissionEndTime Submission end timestamp
     * @param _votingStartTime Voting start timestamp
     * @param _votingEndTime Voting end timestamp
     * @param _allowSponsorVoting Whether to allow sponsor voting
     * @param _allowPublicVoting Whether to allow public voting
     * @param _prizes Array of prize configurations
     */
    function createEvent(
        string memory _name,
        string memory _description,
        string memory _location,
        uint256 _startTime,
        uint256 _endTime,
        uint256 _registrationStartTime,
        uint256 _registrationEndTime,
        uint256 _checkInStartTime,
        uint256 _checkInEndTime,
        uint256 _submissionStartTime,
        uint256 _submissionEndTime,
        uint256 _votingStartTime,
        uint256 _votingEndTime,
        bool _allowSponsorVoting,
        bool _allowPublicVoting,
        Prize[] memory _prizes
    ) public returns (uint256) {
        // Validate event name
        if (bytes(_name).length == 0) {
            revert EmptyEventName();
        }
        if (bytes(_name).length > MAX_STRING_LENGTH) {
            revert StringTooLong();
        }

        // Validate time ranges
        if (_endTime <= _startTime) {
            revert InvalidTimeRange();
        }

        // Validate string lengths
        if (bytes(_description).length > MAX_STRING_LENGTH || 
            bytes(_location).length > MAX_STRING_LENGTH) {
            revert StringTooLong();
        }

        // Validate time sequence: all stage times should be within event time range
        if (_registrationStartTime < _startTime || 
            _registrationEndTime > _endTime ||
            _checkInStartTime < _startTime || 
            _checkInEndTime > _endTime ||
            _submissionStartTime < _startTime || 
            _submissionEndTime > _endTime ||
            _votingStartTime < _startTime || 
            _votingEndTime > _endTime) {
            revert InvalidTimeSequence();
        }

        // Validate stage time order
        if (_registrationEndTime <= _registrationStartTime ||
            _checkInEndTime <= _checkInStartTime ||
            _submissionEndTime <= _submissionStartTime ||
            _votingEndTime <= _votingStartTime) {
            revert InvalidTimeSequence();
        }

        // Validate prizes
        if (_prizes.length > MAX_PRIZES) {
            revert InvalidPrizeCount();
        }

        // Validate prize data
        for (uint256 i = 0; i < _prizes.length; i++) {
            if (bytes(_prizes[i].name).length == 0) {
                revert EmptyEventName();
            }
            if (bytes(_prizes[i].name).length > MAX_STRING_LENGTH ||
                bytes(_prizes[i].description).length > MAX_STRING_LENGTH ||
                bytes(_prizes[i].amount).length > MAX_STRING_LENGTH) {
                revert StringTooLong();
            }
        }

        eventCounter++;
        uint256 eventId = eventCounter;

        events[eventId] = Event({
            id: eventId,
            name: _name,
            description: _description,
            location: _location,
            startTime: _startTime,
            endTime: _endTime,
            registrationStartTime: _registrationStartTime,
            registrationEndTime: _registrationEndTime,
            checkInStartTime: _checkInStartTime,
            checkInEndTime: _checkInEndTime,
            submissionStartTime: _submissionStartTime,
            submissionEndTime: _submissionEndTime,
            votingStartTime: _votingStartTime,
            votingEndTime: _votingEndTime,
            currentStage: EventStage.Registration,
            organizer: msg.sender,
            allowSponsorVoting: _allowSponsorVoting,
            allowPublicVoting: _allowPublicVoting,
            exists: true
        });

        // Add prizes
        for (uint256 i = 0; i < _prizes.length; i++) {
            eventPrizes[eventId].push(_prizes[i]);
        }

        emit EventCreated(eventId, _name, msg.sender, _startTime, _endTime);
        return eventId;
    }

    /**
     * @dev Get event details
     * @param _eventId Event ID
     */
    function getEvent(uint256 _eventId) public view returns (Event memory) {
        if (!events[_eventId].exists) {
            revert EventNotFound();
        }
        return events[_eventId];
    }

    /**
     * @dev Get prizes for an event
     * @param _eventId Event ID
     */
    function getEventPrizes(uint256 _eventId) public view returns (Prize[] memory) {
        if (!events[_eventId].exists) {
            revert EventNotFound();
        }
        return eventPrizes[_eventId];
    }

    /**
     * @dev Update event stage (only organizer)
     * @param _eventId Event ID
     * @param _newStage New stage
     */
    function updateStage(uint256 _eventId, EventStage _newStage) public {
        if (!events[_eventId].exists) {
            revert EventNotFound();
        }
        if (events[_eventId].organizer != msg.sender) {
            revert Unauthorized();
        }

        EventStage oldStage = events[_eventId].currentStage;
        events[_eventId].currentStage = _newStage;

        emit EventStageUpdated(_eventId, oldStage, _newStage);
    }

    /**
     * @dev Update event information (only organizer)
     * @param _eventId Event ID
     * @param _name New name
     * @param _description New description
     * @param _location New location
     */
    function updateEvent(
        uint256 _eventId,
        string memory _name,
        string memory _description,
        string memory _location
    ) public {
        if (!events[_eventId].exists) {
            revert EventNotFound();
        }
        if (events[_eventId].organizer != msg.sender) {
            revert Unauthorized();
        }

        // Validate inputs
        if (bytes(_name).length == 0) {
            revert EmptyEventName();
        }
        if (bytes(_name).length > MAX_STRING_LENGTH ||
            bytes(_description).length > MAX_STRING_LENGTH ||
            bytes(_location).length > MAX_STRING_LENGTH) {
            revert StringTooLong();
        }

        events[_eventId].name = _name;
        events[_eventId].description = _description;
        events[_eventId].location = _location;

        emit EventUpdated(_eventId, _name);
    }

    /**
     * @dev Get total number of events
     */
    function getEventCount() public view returns (uint256) {
        return eventCounter;
    }

    /**
     * @dev Check if event exists
     * @param _eventId Event ID
     */
    function eventExists(uint256 _eventId) public view returns (bool) {
        return events[_eventId].exists;
    }
}

contracts/PrizePool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title PrizePool
 * @dev Smart contract for managing prize pools with multi-currency support
 */
contract PrizePool is ReentrancyGuard, Ownable {
    // Asset type enumeration
    enum AssetType {
        Native,  // ETH, SOL, etc.
        ERC20,   // ERC20 tokens
        ERC721   // NFTs
    }

    // Prize distribution structure
    struct PrizeDistribution {
        uint256 rank;        // 1 = 1st place, 2 = 2nd place, etc.
        uint256 percentage;  // Percentage of total pool (e.g., 50 for 50%)
        AssetType assetType; // Which asset type to distribute
    }

    // Deposit structure
    struct Deposit {
        address sponsor;
        AssetType assetType;
        address tokenAddress; // ERC20/ERC721 address, or address(0) for native
        uint256 tokenId;     // NFT token ID (if ERC721)
        uint256 amount;       // Amount deposited
        bool distributed;     // Whether prize has been distributed
    }

    uint256 public eventId;
    address public eventContract; // Address of EventManagement contract
    uint256 public lockedUntil;   // Locked until this timestamp

    // Mapping from deposit ID to deposit
    mapping(uint256 => Deposit) public deposits;
    uint256 public depositCounter;

    // Prize distribution configuration
    PrizeDistribution[] public prizeDistributions;

    // Total amounts by asset type
    mapping(AssetType => uint256) public totalAmounts;
    mapping(AssetType => mapping(address => uint256)) public tokenAmounts; // For ERC20/ERC721

    // Track distribution status per asset type and token address
    mapping(AssetType => mapping(address => bool)) public assetDistributed;

    // Events
    event Deposited(
        uint256 indexed depositId,
        address indexed sponsor,
        AssetType assetType,
        address tokenAddress,
        uint256 amount,
        uint256 tokenId
    );

    event PrizeDistributed(
        uint256 indexed rank,
        address indexed recipient,
        AssetType assetType,
        address tokenAddress,
        uint256 amount,
        uint256 tokenId
    );

    event DistributionCompleted();

    modifier onlyEventContract() {
        require(msg.sender == eventContract, "Only event contract can call");
        _;
    }

    modifier notLocked() {
        require(block.timestamp < lockedUntil || lockedUntil == 0, "Pool is locked");
        _;
    }

    modifier onlyWhenLocked() {
        require(block.timestamp >= lockedUntil && lockedUntil > 0, "Pool is not locked yet");
        _;
    }

    /**
     * @dev Constructor
     * @param _eventId Event ID
     * @param _eventContract Address of EventManagement contract
     */
    constructor(uint256 _eventId, address _eventContract) Ownable(msg.sender) {
        eventId = _eventId;
        eventContract = _eventContract;
    }

    /**
     * @dev Deposit native assets (ETH, etc.)
     */
    function depositNative() public payable nonReentrant notLocked {
        require(msg.value > 0, "Amount must be greater than 0");

        depositCounter++;
        deposits[depositCounter] = Deposit({
            sponsor: msg.sender,
            assetType: AssetType.Native,
            tokenAddress: address(0),
            tokenId: 0,
            amount: msg.value,
            distributed: false
        });

        totalAmounts[AssetType.Native] += msg.value;

        emit Deposited(depositCounter, msg.sender, AssetType.Native, address(0), msg.value, 0);
    }

    /**
     * @dev Deposit ERC20 tokens
     * @param tokenAddress ERC20 token address
     * @param amount Amount to deposit
     */
    function depositERC20(address tokenAddress, uint256 amount) public nonReentrant notLocked {
        require(tokenAddress != address(0), "Invalid token address");
        require(amount > 0, "Amount must be greater than 0");

        IERC20 token = IERC20(tokenAddress);
        require(token.transferFrom(msg.sender, address(this), amount), "Transfer failed");

        depositCounter++;
        deposits[depositCounter] = Deposit({
            sponsor: msg.sender,
            assetType: AssetType.ERC20,
            tokenAddress: tokenAddress,
            tokenId: 0,
            amount: amount,
            distributed: false
        });

        totalAmounts[AssetType.ERC20] += amount;
        tokenAmounts[AssetType.ERC20][tokenAddress] += amount;

        emit Deposited(depositCounter, msg.sender, AssetType.ERC20, tokenAddress, amount, 0);
    }

    /**
     * @dev Deposit ERC721 NFT
     * @param tokenAddress ERC721 contract address
     * @param tokenId NFT token ID
     */
    function depositERC721(address tokenAddress, uint256 tokenId) public nonReentrant notLocked {
        require(tokenAddress != address(0), "Invalid token address");

        IERC721 nft = IERC721(tokenAddress);
        require(nft.ownerOf(tokenId) == msg.sender, "Not the owner");
        nft.transferFrom(msg.sender, address(this), tokenId);

        depositCounter++;
        deposits[depositCounter] = Deposit({
            sponsor: msg.sender,
            assetType: AssetType.ERC721,
            tokenAddress: tokenAddress,
            tokenId: tokenId,
            amount: 1, // NFTs are counted as 1
            distributed: false
        });

        totalAmounts[AssetType.ERC721] += 1;
        tokenAmounts[AssetType.ERC721][tokenAddress] += 1;

        emit Deposited(depositCounter, msg.sender, AssetType.ERC721, tokenAddress, 1, tokenId);
    }

    /**
     * @dev Set prize distribution configuration (only owner/organizer)
     * @param distributions Array of prize distributions
     */
    function setPrizeDistributions(PrizeDistribution[] memory distributions) public onlyOwner {
        delete prizeDistributions;
        uint256 totalPercentage = 0;

        for (uint256 i = 0; i < distributions.length; i++) {
            require(distributions[i].percentage > 0, "Percentage must be greater than 0");
            totalPercentage += distributions[i].percentage;
            prizeDistributions.push(distributions[i]);
        }

        require(totalPercentage <= 100, "Total percentage cannot exceed 100%");
    }

    /**
     * @dev Set lock time (only event contract)
     * @param _lockedUntil Timestamp until which pool is locked
     */
    function setLockedUntil(uint256 _lockedUntil) public onlyEventContract {
        lockedUntil = _lockedUntil;
    }

    /**
     * @dev Distribute prizes to winners (only owner/organizer, after lock period)
     * @param winners Array of winner addresses (index corresponds to rank - 1)
     * @param assetType Asset type to distribute
     * @param tokenAddress Token address (if ERC20/ERC721)
     */
    function distributePrizes(
        address[] memory winners,
        AssetType assetType,
        address tokenAddress
    ) public onlyOwner onlyWhenLocked nonReentrant {
        require(!assetDistributed[assetType][tokenAddress], "This asset already distributed");
        require(winners.length > 0, "No winners provided");

        uint256 totalToDistribute = 0;
        if (assetType == AssetType.Native) {
            totalToDistribute = totalAmounts[AssetType.Native];
        } else if (assetType == AssetType.ERC20) {
            totalToDistribute = tokenAmounts[AssetType.ERC20][tokenAddress];
        } else if (assetType == AssetType.ERC721) {
            totalToDistribute = tokenAmounts[AssetType.ERC721][tokenAddress];
        }

        require(totalToDistribute > 0, "No funds available for this asset type");

        // Distribute according to prize distribution configuration
        for (uint256 i = 0; i < prizeDistributions.length && i < winners.length; i++) {
            if (prizeDistributions[i].assetType != assetType) {
                continue;
            }

            uint256 rank = prizeDistributions[i].rank;
            if (rank > winners.length) {
                continue;
            }

            address winner = winners[rank - 1];
            if (winner == address(0)) {
                continue;
            }

            uint256 amount = (totalToDistribute * prizeDistributions[i].percentage) / 100;

            if (assetType == AssetType.Native) {
                (bool success, ) = winner.call{value: amount}("");
                require(success, "Transfer failed");
            } else if (assetType == AssetType.ERC20) {
                IERC20 token = IERC20(tokenAddress);
                require(token.transfer(winner, amount), "Token transfer failed");
            } else if (assetType == AssetType.ERC721) {
                // Find an available NFT from deposits and transfer it
                IERC721 nft = IERC721(tokenAddress);
                bool nftFound = false;

                for (uint256 j = 1; j <= depositCounter && !nftFound; j++) {
                    if (deposits[j].assetType == AssetType.ERC721 && 
                        deposits[j].tokenAddress == tokenAddress &&
                        !deposits[j].distributed) {

                        nft.transferFrom(address(this), winner, deposits[j].tokenId);
                        deposits[j].distributed = true;
                        emit PrizeDistributed(rank, winner, assetType, tokenAddress, 1, deposits[j].tokenId);
                        nftFound = true;
                    }
                }

                if (!nftFound) {
                    continue; // Skip if no NFT available for this rank
                }
            } else {
                emit PrizeDistributed(rank, winner, assetType, tokenAddress, amount, 0);
            }
        }

        assetDistributed[assetType][tokenAddress] = true;
        emit DistributionCompleted();
    }

    /**
     * @dev Get total amount for an asset type
     * @param assetType Asset type
     */
    function getTotalAmount(AssetType assetType) public view returns (uint256) {
        return totalAmounts[assetType];
    }

    /**
     * @dev Get token amount for a specific token address
     * @param assetType Asset type
     * @param tokenAddress Token address
     */
    function getTokenAmount(AssetType assetType, address tokenAddress) public view returns (uint256) {
        return tokenAmounts[assetType][tokenAddress];
    }

    /**
     * @dev Get deposit information
     * @param depositId Deposit ID
     */
    function getDeposit(uint256 depositId) public view returns (Deposit memory) {
        return deposits[depositId];
    }

    /**
     * @dev Get prize distribution count
     */
    function getPrizeDistributionCount() public view returns (uint256) {
        return prizeDistributions.length;
    }

    /**
     * @dev Check if a specific asset type has been distributed
     */
    function isAssetDistributed(AssetType assetType, address tokenAddress) public view returns (bool) {
        return assetDistributed[assetType][tokenAddress];
    }

    /**
     * @dev Emergency withdraw (only owner, before lock)
     */
    function emergencyWithdraw() public onlyOwner notLocked {
        require(address(this).balance > 0, "No funds to withdraw");
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Withdrawal failed");
    }
}

